
public class String11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s1="JAVA";
		String s2="PYTHON";
		
		String s3=s1+s2;
		String s4=s1+s2;
		
		if(s3==s4) {
			System.out.println("String References are equal");
		}
		else {
			System.out.println("String References are not equal");
		}
	}

}
